  CONSTRAINT `equipment_ibfk_2` FOREIGN KEY (`last_borrower`) REFERENCES `users` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '实验设备详细信息表' ROW_FORMAT = Dynamic;

